import React from "react";
import HeadCell from "./HeadCell/index";

const TableHead = ({ matrix }) => {
   const heads = matrix.map((item, index) => {
      if (index === 0) {
         return <HeadCell key={index} value=""></HeadCell>;
      } else if (index > 0) {
         return <HeadCell key={index} value={"col " + index}></HeadCell>;
      }
   });

   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
